import { Component, OnInit, ViewChild, SimpleChanges} from '@angular/core';
import { FormBuilder, FormGroup, Validators } from '@angular/forms';
import { ScenarioService, TraductionService } from '../_services';
import * as moment from 'moment/moment.js';
import { DatePipe } from '@angular/common';
import jsPDF from 'jspdf';
import 'jspdf-autotable';


import {  ElementRef } from '@angular/core';
import { ResultatService } from '../_services/resultat.service';
declare const $: any;


@Component({
  selector: 'app-log',
  templateUrl: './log.component.html',
  styleUrls: ['./log.component.css']
})
export class LogComponent implements OnInit {
  
  logScenario=[];
  resultForm: FormGroup;
  dateDebut
  dateFin
constructor(public result2:ResultatService, public result:ScenarioService,public ScenarioService:ScenarioService,private formBuilder: FormBuilder,public traduction :TraductionService,public datepipe: DatePipe,private elementRef:ElementRef){
}


  ngOnInit() {
    this.onReset();
    this.listScenario();
  }


onSubmit() {
if(this.resultForm.value.idScenario==''){
$('#default-confirmation3').modal('show');
}else{
  if(!this.resultForm.value.dateDebut.includes("T00:00")){
    this.resultForm.value.dateDebut=this.resultForm.value.dateDebut+"T00:00";
    this.resultForm.value.dateFin=this.resultForm.value.dateFin+"T23:59";
  }

  this.result.resultatLogScenario(this.resultForm.value).then((data:any)=>{
    this.logScenario=data;
    console.log(data)
  
  });

}

 

}


onReset(){
  this.dateDebut= moment(new Date()).format("YYYY-MM-DD");
  this.dateFin= moment(new Date()).format("YYYY-MM-DD");
  console.log(this.dateDebut)
  this.resultForm = this.formBuilder.group({
    idScenario: ['', Validators.required],
    dateDebut: ['', Validators.required],
    dateFin: ['', Validators.required],
});

}



Scenarios=[];
listScenario(){
  this.ScenarioService.getAll().subscribe((data:any)=>{
    console.log("scenarios--->",data)
    this.Scenarios=data;

  })

}




exportAsXLSX():void {
  var filename="Traçabilité de "+this.datepipe.transform(this.dateDebut, 'dd-MM-yyyy HH:mm')+" a "+this.datepipe.transform(this.dateFin, 'dd-MM-yyyy HH:mm');
  var voixArray=[]
  this.logScenario.forEach(element => {
   
      var  item={
        "Date":this.datepipe.transform(element.date+" ", 'dd-MM-yyyy HH:mm:ss'),
        "Message":element.message
      }
      voixArray.push(item);
    
  });
  
  this.result2.exportLog(filename,voixArray);

  }
  

exportAsPDF(){

    let doc = new jsPDF();
    doc.autoTable({html: '.ok'});

    doc.addImage(this.logotariff, 'PNG', 10, 10, 30, 20);
    doc.setFontSize(14);
    doc.text("Autorité de Régulation des \nCommunications Electroniques \net des Postes" , 45, 15);
  
    doc.setFontSize(12);
    doc.text("BURKINA FASO" , 154, 15);
    doc.setFontSize(10);
    doc.text("UNITE - PROGRES - JUSTICE" , 145, 20);
    doc.setFontSize(14);
    doc.text("Traces d'exécution de scénario" , 75, 40);

  var table=[];
  var tableHead=[
    [
      {content: "Date" , styles: {halign: 'center',width:30}},
      {content: "Message", styles: {halign: 'center'}},
      ]];

    this.logScenario.forEach(element => {


      table.push([
        this.datepipe.transform(element.date+" ", 'dd-MM-yyyy HH:mm:ss'),
        " "+element.message
    
      ]);


    });



    doc.autoTable({
      startY: 50,
      styles: {

         columnWidth: 'wrap',
         font: 'arial',
         fontSize: 10,
         cellPadding: 0.2,
         overflowColumns: 'linebreak'
    },
    columnStyles: {
      0: {
          columnWidth: 30
      },
      1: {
          columnWidth: 'auto'
      }
  },
      head: tableHead,
      body: table,
  });


  var i;
  var pageCount = doc.internal.getNumberOfPages();
  for(i = 0; i < pageCount; i++) { 
  doc.setPage(i); 
  doc.setFontSize(8);
  doc.text(20,284, "___________________________________________________________________________________________________________ ");
  doc.text(28,288, "ARCEP - Adresse:  01 BP 6437 Ouagadougou 01, Burkina Faso, E-mail : secretariat@arcep.bf, Site Web: www.arcep.bf");
  doc.text(80,294, "");
  }
  

    doc.save('Traçabilité de '+this.datepipe.transform(this.dateDebut, 'dd-MM-yyyy')+" à "+this.datepipe.transform(this.dateFin, 'dd-MM-yyyy')+'.pdf');   
  }
  
logotariff=``

logosfm=``

}